65521	12622	8	Great recording. Ok performance	Recording is awesome quality but the performance is my least favorite of the tour so far.\n Shakedown lacks oomph, TLEO is missing its lilt and lightness, Jack Straw and He's Gone sound Ratdog slow to me.This may be partially due to how high John is in the mix. I can hear every little nuance of his playing but can barely make out the rest of the band, especially Jeff.\nAs for John, he is undeniably a great guitarist. He does a better job of the basics then most but I don't get any sense of great creativity from him.I get the sense he is playing over the others instead of with them.\nI'm still ecstatic they're touring and look forward to hearing how they progress. \nRecording 5, Performance 3	jjuggler	2016-07-07 13:54:13-04	2015-11-09 20:20:46-05
65522	12622	8	the official name of the band is "Dead & Company"	The name of the recording should be changed to "Dead & Company" so that it all the recordings can be searched using the same name.\n	jr midtown	2016-07-07 13:54:13-04	2015-11-14 13:19:04-05
65523	12622	8	Priming the engine	I haven't seen the Grateful Dead since Jerry's last show in '95. The desire just wasn' there. That has all changed though. I work with a Phish-Head and his appreciation of the Dead has awoken my love of the band after 25 years of hibernation and now I find myself with a ticket in hand to truck up to Minneapolis on 11/21 to catch a Dead and Company Show. I was curious what the guys sounded like with John Mayer and I have to admit I am impressed. They sound good and for the first time since I was a young 20 something wipper-snapper, I am getting pumped to see a show! If the Dead-N-C sound this good when I see them, I will really happy!	Dandysan	2016-07-07 13:54:13-04	2015-11-10 18:38:23-05
65524	12623	10	Thank you	Thank you for recording and sharing!\n\nSource added:\nhttp://db.etree.org/shn/134656	wharfratjoe	2016-07-07 13:54:13-04	2015-11-16 07:17:53-05
