65526	12623	10	Dead & Company Live At Nationwide Arena	Thank you so much for taping and uploading the audio for this particularly moving and fantastic concert. And thanks for the notes too! You all provide sacred content to relive these shows over and over!	Mimimph	2016-07-07 13:54:13-04	2015-11-16 14:03:23-05
65527	12623	8	13:31	Thanks for posting.  Was at the show and it was clear they are still a "new" band working out the kinks and timing.  Check out TN Jed at around 5:30.  You'll hear some original GD traveling.  John misses Bob's cue for the ending (around 6min) and what happened after that was pure gold.  Place was electric.  There are some other wonky moments but this was a solid show overall.	KillEer Bee	2016-07-07 13:54:13-04	2015-11-17 18:31:15-05
65528	12623	10	Great Show Overall	Was in the pit, started off near the back and worked our way in deep to Oteil side very close to the stage. The vocals were not clear as the stacks were "behind" us ,, but the stage sound was amazing. They played very tight.  The flubs were few and they got back on track quickly.  I did notice the John miscue someone else noted in their post ,,, the recovery was excellent (but his face gave it away that we was in a brain freeze for a moment).  Mickey went off to a hook/ending a bit early and the place went wild in appreciation ,,, that special synergy. Have to admit John did his homework and did an outstanding job. Oteil ,,, what an artist ,,, he is one with his bass and clearly very happy to be playing with this band. Setlist was strong and I could not be happier that I made the trip.	gnamian	2016-07-07 13:54:13-04	2015-11-18 17:35:56-05
