65617	12653	10	Best of Tour?	This show has to be in the running for best of tour, imo.\nJohn and Oteil add so much energy to this band and this music.  I've seen just about every iteration of the Dead going back over 25 years, and this has to be one of the best.  John's guitar work captures the spirit of Jerry's playing, but within the framework of his own style.  In truth, Mayer's style on guitar was already very similar to Jerry's in their use of melodic runs tempered by just the right placement of tasty, twangy, bendy guitar riffs.  It really sounds like John and Oteil have taken the body of work, spirit and style from Jerry and Phil respectively and evolved it through to the next level within its own natural progression.  Really lovely playing throughout on this one.  I've never been a huge fan of Bobby's singing, but he has really been giving a great effort where that is concerned.  He has surpassed my expectations in that regard.  I think Bobby and John may play together as well as anybody since Jerry.\nI am so excited to be going to NYE!\nBy the way, this recording is as good as I've heard.  Great job Robert Mullen.  Nice presence across all frequencies.  Well balanced recording and well behaved audience around the tapers.	jpos	2016-07-07 13:54:22-04	2015-12-13 22:24:42-05
