65670	12673	8	Sweet sounds in St. Louis - set one review	As of this shows end, So far this tour no song has been played more than four times.  Tonight, the first pair of songs were among those played repeatedly (a relative term for the DEAD) this tour, Shakedown Street and Brown-Eyed Women. Both songs sounded quite good, better than the versions preceding them this opening tour. I especially like Chimenti's soloing during Brown-Eyed Women. Shakedown Street has an excellent closing section (starting at 8:10) with the last section of verses and then a vocal breakdown about how every town has heart, you just gotta poke around. There's good people & good times everywhere, you just gotta find them.  Such great lyrics...   Up next, New Minglewood Blues is sung strong & well and John Mayer's guitar work really shines, except when Bob overdoes his slide guitar part from about 5:05 - 6:05, ugh - a whole minute of that screeching and then John takes it back into the stratosphere to finish it off. The rock 'n' roll vibe  of Minglewood gave way to a breezy, bouncy, and mellow They Love Each Other.  Mayer sounds great singing this song (and Brown-Eyed Women) and his slow jam licks are spot-on.  I really dig this song.  For the Fifth song of the set, we have a tune new to this tour, Black-Throated Wind.  This has long been one of my favorite "Bobby" songs. The lyrics are so trippy and I love the cosmic-blues-rock singing done over the quirky road song. I thought it achieved lift-off and got the crowd pumped up for a rousing and stellar version of Sugaree. John' blues vocals were on display and the band had a thick groove swinging.  The playing was great but at times the crowd's singing/cheering covered some of that up. Not much though, so no big deal.  Finally to end the set, The Music Never Stopped.  How can anyone who appreciates music not like this song.  The music, the lyrics, the overall vibe... this is one of those perfect songs.	slavetothegroove	2016-07-07 13:54:27-04	2015-11-22 01:33:21-05
