65742	12688	8	some highlights (Sugaree and...)	Row Jimmy is notable:  Weir starts rowing with his guitar (yep) at 7:48 (you can see this on the crystal clear video by Johnny A), and Mayer delivers wonderful fills during the singing of the "gonna get there" chorus.  First time played of three during the tour (11-21 and 11-27), great work.\n\nSugaree is Mayer's signature song and he delivers the goods.  His first two solos are refreshingly restrained and short, saving the heavy hitting for his third time round at  6:52.  He opens with chords and speed and takes off with passion and creativity worthy of Garcia, culminating in a frenzied blur around 7:45 and another peak around 8:11.  Worth the price of admission and then some.\n\nRamble on Rose is another tune that suits Mayer perfectly (Weir's singing is actually OK on this)(sort of).  Check out his second set of solos after the piano around 5:22 and again at 6:35, simply stunning.  Beautiful to hear the crowd in full throat on the "royal flush" behind Weir.\n\nBig River, not as successful, the solo is fairly ordinary, what any very talented cover player might do.   Deal was a quandry for them every time played (10/31, 11/18, 11/28), with some real confusion about who should solo, when, and how to get to the final chorus.  But by 6:49 all that is under the bridge and Mayer is free to rock out on the three chords and it finally works.\n\nThe transition from there to Uncle Johns is seamless, a bit of good old Grateful Dead-style magic.  Dear Prudence, played twice on the tour (11-21), Mayer's solo starting around the 5 minute mark is is not to be missed, a triumph.  Thanks for sharing the nice recording of the show...	dcain	2016-07-07 13:54:31-04	2015-12-26 02:13:50-05
