65974	12757	0	Getting better all the time	I was listening to this show on the XM/Sirus Broadcast the other night. As unlikely as it may seem (in perhaps my mind only) to conceive that they would gel so well with Jon Mayer, that's exactly what is happening. \n\nThe two Boulder shows were incredible. As a long time head I have to say that this iteration of post Jerry Dead troupes is arguably the most interesting (note that I have not said the best, because that term pins the tunes into a box of subjectivity that I see all too many heads get stuck in, it's the music that continues to evolve through all who have decided to get on the bus). \n\nThat being said I was blown away with Bobby's singing of Tennessee Jed, haven't heard him reaching out of his vocal comfort zone to let Jerry breathe through his vocals in that manner before. I was completely mesmerized by the under played/under appreciated/barely known 'Even So'. Very fitting given the untimely demise of one of the most influential and amazing bassists, Rob Wasserman. I could overhear some fans (annoyingly) talking under the song, they didn't recognize it and thought it was a but depressing. But if they'd bothered to let things be w/o feeling as if they need to comment on things they do nit understand then I believe they would've appreciated it even more. The rest of the show was great. Thank you for posting this show. I hope these guys continue to brew up some more amazing music to keep the songs alive for a couple more decades.	GenXHead33	2016-07-07 13:54:45-04	2016-07-05 21:10:29-04
