66889	13118	10	Outstanding.	This was my 7th time seeing lotus and the 4th time this year...Its amazing seeing the progress of this band as time goes by. The Bubonic Tonic opener was a really high energy start to the show, and they kept it going for the rest of the set. Middle Road was so sweet to hear, haven't heard it since my first time seeing them at the Boulder Theater on April 17th, 2010.\n\nAll Clear to Me Now totally blew my mind to pieces...the way they totally mellowed it down into silence before blasting off into the face melting uptempo ragefest was absolutely flawless. \n\nUnfortunately I missed Greet the Mind because I went with my girlfriend to move her car...but when we came upstairs the lights were going crazy! Their light setup now is top notch, totally chill but excitingly psychedelic at the same time. Their second set seemed to bounce a little bit more than the first one, with some insane jams in there. Mike gave me the setlist after the show...that sandwich is friggin ridic. Flower Sermon > F# jam > trip (idk what this is supposed to mean) > Dowrn  > Sermon with accents in F# > Accents B > Sunrain. Whoa. Its cool to see that they have certain stuff written on the setlist to let the band know what kind of jam section will be coming up. I also noticed a lot of communication between Jesse and Luke up there. Everything was on point.\n\nThere was very little mistakes, and even the mistakes that were made were subtle and they did a great job of playing them off. It was like they somehow worked with the song. The encore was dope, super bassy, dancy goodness. Definitely the best Lotus show I have seen/heard and probably one of the best shows I have ever seen period.	Garciarrhea	2016-07-07 14:17:42-04	2011-11-14 03:21:26-05
