66982	13031	10	A True Must Hear.	This night at NLQP will for sure go down in the all-time books for Lotus fans. Magical comes to mind. Unique. Perfect. Lets add it up: 1. NLQP is the most beautiful and hospitible spot you could hope for for a midsize summertime fest. A quarry to swim in, cliffs to jump off, trees to camp in, no long walking to anything, and a true family ownership that has deep roots in ohio. 2. Perfect weather all weekend. 3. Tons of Lotus Family in full force and a very pumped and danceready crowd otherwise, as always! 4. Lotus brought the Heat 110% and never looked back. From a debatebly perfect setlist..to flawless, mature improvs/jam sections and transitions..to moments of insanity and almost industrial/heavy metal(listen to parts of micksnack and hammerstrike! Mikey is so on fire i thought his guitar was gonna turn into a demon and eat our souls!)..to straight down and dirty funk stylee.. they covered so much ground, interpreting old material in new fresh ways, with a handfull of slightly newer songs, but in a way where the entire night had a cetain feel and flow to it that was all one cohesive unit. The Playing all around was superb and imo this will truely be considered an all time great Lotus show for years to come. The Recording itself is as flawless as the show, which makes this all the more worth it. The Universe (and Bean!) was making sure this night could be enjoyed, at least vicariosly, for everyone out there who has any sense of Lotus at all. Im not kidding, this is a true must own show.  The Set 1 Intro Improv set the mood for the entire night..listen and get the jist of that feel and you'll have a indication of where this is all going..which they took right into a smooth and slower Nematode, ever so slightly flubbing the transition(hey if im gonna give it a 5 and hype it up i gotta point out whatever flubs i can..when u listen i doubt youll even notice!), continuing the subtle danceparty vibe they set up, slowly building into the first signs of rage for the night before dropping back into the main theme and ending it. Then the familiar banjo sounding notes of Reich! Again continuing the slow estatic dance party as the sun was setting now..a very solid reich indeed..right into Slow Cookin'..good good version also, calm..then funky..then slowly building into the first full on electronica of the night right into Moonset!! perfection. controlled. mature. building into a deep rage at the end. Very Nice. Next Came Livingston. I gotta say they for sure were outta synch for the first 2-3 min or so, which would be this only nights blatant nonperfection, but man do they recover. First its a farily normal storm..building into this weird almost aboriginal industrial weirdness. Lukes just usuing these wicked crazy tones underneath Mikeys usual Storm tones..its really interesting. Then whats this..like 30 secs or so of some bonafide feedback/space that drops right into a Sick Sick Sick Mikesnack! Man this ones hot!! Imma just say listen to it in its entirety and tell me anyone in the scene has better tone than Mikey..and hes just on fire! Now the set closer. Age of Inexperience. I gotta say this is one of my least fav lotus songs..i lit up a cig..they got through the opening composed section..i was like halfway done with my smoke..then the jam kicked in..Holy Heaven..i was drawn right back into the danceparty blackhole of goodness all around me. Wow this jam is massive. Hasnt sold me on the beginning of the song, but at least i know theres an sick jam coming after its over!(aka Twist from Phish, heh.) All in all at least a 7/10 first set that alone deserves a listen, with moments of brilliance all over it. But here comes the kicker. Set 2 of this show may be the best single set of lotus music ever, certainly the most mature and the most descriptive of their current mood and direction, all while usuing older material to illustrte this. I cant tell you enough about this set of music. To not hear it is ear-abuse. the operner Expired slang is always welcome, not to mention its flawless and everything that song could possibly be. Then the first sandwich of the night..Jump->Jug->Jump. Wow. Intense. Perfect. This may quite simply be the best juggarnaut ever. Beyond words while it was going down..the entire crowd just synched up into one psychic dance fever organism..that finally drops back into a raging jump ending that just seals the deal. You will love this, i thought this had to be the peak of the night. Oh no no no, my friends. What we have next is the Meat of the evening. Didd Fatt!!!! Oh glory how long i been wanting to catch this..right on with the ever evolving yet coherant mood of the night..so tight..leading right into the straight up, down and dirty, make you wanna f%$#, funk of Sid!! There had been hints of the funk all night that all came to a culmination in this sid. And suddenly right in the middle they drop into this phishesqe evil circus theme for a few seconds thats just freaky as hell..very nice. Again, just perfect mature jams and tight ass grooves...that leads right into Sermon!! Which just then proceeds to take the whole night to its final peak..right where it should be at the end of the second set. Danceparty isnt the word. We need a new Term for the Physicality of what goes down at a Lotus show cause its just 5 steps above. Such a clean vibe..so many smiles..such deep funk..what a night..what a scene. Then the owner Evan of nelsons comes out and gives a nice speech real quick, ensuring future Lotus Family gateherings at the Ledges! They Encore with Hammerstrike. At first i was hoping for a wax or spiritualize encore..but after listening 4x to the recording i realize this was the perfect closer to complete and dissolve the mood of the evening and release us all to the 6 hours of latenight goodness partying that then proceded to happen. This also may be a top version of hammerstrike..with Mikey again just slaughtering his guitar on this one near the end of the jam. Side notes: Dj Harry spun between sets and if you havent seen him yet make a point to..hes just amazing and so dirty. It was so nice to just wander 30 yards between sets and have him steal your face like what. A perfect night indeed. Download this right now..you NEED to hear this one peoples! namaste.	Mike D. (Denver)	2016-07-07 14:30:46-04	2008-08-08 03:40:03-04
