12639	13411	f	f	8.5	12	dead2015-11-28	f	Dead & Company\n2015-11-28\nMGM Grand Garden Arena\nLas Vegas, NV USA \n\nRecorded & Transfered By: Robert Mullen (lvrwm) \n\nEquipment/Lineage: Audience/SP-CMC-25 mics (Croakies)>SP-SPSB-11(Battery \nBoost Box, with bass-roll-off at 69Hz)>Sony PCM-M10>CD Wave Editor(tracking)>\nTraders Little Helper flac level 8. \n\nRecorder Settings: PCM-M10 at 44.1 kHz/16 bit, low mic sensitivity, manual \nrecord, limiter on, mic power off, low cut filter off, speed control off. \n\nComments: Here is our capture of this new incarnation of remaining Grateful\nDead members and some young-bloods or young-guns joining in for the Fun! Dead\n& Company. The saturday night crowd was enthusiastic for this show, and well \nbehaved near this recorder. The sound mix was very good and the recording \ncame out well. Enjoy! \n\nPlease: Support This Band/Artist And All Bands/Artists You Enjoy.\nPlease: Convert to lossy format only for personal use. \nPlease: Do Not Buy or Sell This Recording. \nPlease: Trade Freely, Keeping The Recorder And Lineage Information Intact. \nPlease: Relax and Enjoy! \n\n\nTracklist: \n\nSet One\n\n01-Tuning-> 02:30\n02-Cassidy-> 10:14\n03-Loose Lucy 09:05\n04-West LA Fade Away-> 09:32\n05-Ramble On Rose 11:36\n06-Tennessee Jed 08:50\n07-Sugaree 15:08\n08-Deal 10:11\n09-One More Saturday Night 05:51\n\nSet Two\n\n10-Tuning-> 01:01\n11-Help On The Way-> 11:40\n12-Franklin's Tower-> 09:58\n13-Scarlett Begonias-> 08:36\n14-Fire On The Mountain-> 07:33\n15-Drums->Space-> 20:16\n16-That's It For The Other One-> 12:53\n17-Morning Dew 11:53\n18-Turn On Your Lovelight 08:56\n19-Crowd (Encore Break) 02:01\n\nEncore\n\n20-Brokedown Palace 08:21\n\nTotal: 186 minutes 05 seconds\n\n\nPerformed By:\n\nBob Weir - Guitar, Lead Vocals\nMickey Hart - Drums\nBill Kreutzmann - Drums\nJohn Mayer - Guitar, Lead Vocals\nOteil Burbridge - Bass, Backing Vocals\nJeff Chimenti - Keyboards, Backing Vocals\n\nRemember, It's Only A Memory If It's Not Recor