12622	13399	f	f	7.33333349	6	GD2015-11-07	f	Dead & Co\nMadison Square Garden\nNew York City, NY\nSaturday November 7, 2015\n\nSource: AKG 451ck8 mics>Sony D5 (as Preamp)>Sony M10 @24bit/48kHz.\nLocation: FOB Second level Section 224 Row 18 seat 12 on a 5 foot stand and shotguns pointed directly at the left stacks.\nLineage: Sony M10>Sound Forge Studio 9.0 for tracking, conversions and mastering to 16bit/44.1kHz CDR>Free Rip v2.0 FLAC level 8.\nTaped, transferred, converted, mastered and uploaded by Mark Van Blunk MVB\n\nSetlist:\nSet 1: Shakedown St.>I Need A Miracle>Cold Rain & Snow, Tennessee Jed, They Love Each Other, Jack Straw. (58.14)\nSet 2: Help on the Way>Slipknot>Franklin's Tower>He's Gone>Saint Stephen>Drums/Space>The Other One>Stella Blue>Not Fade Away.\nEncore: Brokedown Palace (1:47.13)	Tweren't Easy!\nSince the show was completely "sold out" via free giveaway from American Express, there was no way to get taper tickets.  I tried everything I could to get into the taper section or any place that would have been conducive to recording the show, I was told by Guest Relations to set up at my assigned seat and that was the best they could do.  Therefore I had no choice but to set up in Section 224.  Absolutely astoundingly surprised to find that the tapes actually sound great!  So, here they are for you to enjoy!\nSpecial thanks to my good buddy Tyler for everything and all the supportive folks in section 224, you know who you are!  Cheers!\nPlease look for my other Dead & Co live recordings here on Archive:\nAlbany, NY : GD2015-10-29 details page\nWorcester, MA Still to come...Probably GD2015-11-10 details page\n\nThanks and Enjoy!\nMVB	AKG 451ck8 mics>Sony D5 (as Preamp)>Sony M10 @24bit/48kHz.	Mark Van Blunk	Mark Van Blunk	Sony M10>Sound Forge Studio 9.0 for tracking, conversions and mastering to 16bit/44.1kHz CDR>Free Rip v2.0 FLAC level 8.	2016-07-07 13:54:13-04	2016-01-19 01:51:53-05	2	33.4761925	9514	1925	2015-11-07
