12688	13400	f	f	9.3103447	29	GD2015-11-10	f	Dead & Co\nDCU Center\nWorcester, MA\nTuesday November 10, 2015\n\nSource: AKG 451ck8 mics>Sony D5 (as Preamp)>Sony M10 @24bit/48kHz.\nLocation: OTS Section 103 Row LL Seat 7 DFC on a 10 foot stand with shotguns pointed directly at the main stacks.\nTransfer and lineage: Sony M10>Sound Forge Studio 9.0 for tracking, mastering and conversion to 16bit/44.1kHz>CDR>Free CD Ripper v2.0 FLAC level 8.\nRecorded, transferred, mastered and uploaded by Mark Van Blunk MVB\n\nSetlist\nSet 1: Cassidy, Row Jimmy, Ramble on Rose, Big River, Peggy O, Sugaree, Music Never Stopped. (1:15.42)\nSet 2: Deal>Uncle John's Band>Estimated Prophet>Terrapin Station>Drums/Space>Dear Prudence>Get Out of My Life Woman>GDTRFB.\nEncore: Ripple* (1:39.04)\n\n*=Acoustic guitars for Bobby and John Mayer	This time I had a taper ticket, so I was set up in the Official Taper section.  It was smack in the middle of the section 103 metal risers that were very noisy and the crowd chatter was surrounding us.  However, you wouldn't know any of that by listening to my recording.  It sounds pristine and I am very happy with the quality.  I hope you all enjoy it too!  \nIt was a great little tour for me with Dead & Co and again I was very impressed with the lineup.  This show was my favorite of the three.  Lots of energy and the band is really coming together.  Otiel was really jamming as was everyone!  Including the crowd.  Plenty of chill bumps on this one!\n\nPlease look for my other Dead & Co recordings here on Archive.org\n\nAlbany , NY 10-29-15 under Bob Weir's collection GD2015-10-29 details page\nMSG, NYC, NY 11-07-15 under The Dead  GD2015-11-07 details Page\n\nThanks to all the other tapers, it was great hanging with you all in the OTS!  Hope all your recordings came out well!\n\nEnjoy!\nMVB	AKG 451ck8 mics>Sony D5 (as Preamp)>Sony M10 @24bit/48kHz.	Mark Van Blunk	Mark Van Blunk	Sony M10>Sound Forge Studio 9.0 for tracking, mastering and conversion to 16bit/